import {
  Image,
  StyleSheet,
  Text,
  TouchableOpacity,
  View,
  Linking,
  Modal,
} from "react-native";
import React, { useState } from "react";
import { SafeAreaView } from "react-native-safe-area-context";
import Config from "react-native-config";
import * as GoogleSignIn from 'expo-google-sign-in'; // This is an example, you might need a different library

const OnboardingFive = ({ navigation }) => {
  const [showModal, setShowModal] = useState(false);

  const handleGoogleSignIn = async () => {
    try {
      setShowModal(true);
    } catch (error) {
      console.error("Error signing in with Google:", error.message);
    }
  };

  const handleCloseModal = () => {
    setShowModal(false);
  };

  const handleDeepLink = async (event) => {
    const url = event.url;
    if (url && url.startsWith(Config.MAGIC_CALLBACK_URL)) {
      // Handle the redirect here
      const authorizationCode = url.split("code=")[1];

      // Perform further actions like exchanging the code for a token
      // For example, you could send this code to your backend to exchange it for an access token
      // Then, use the access token for API calls or user authentication

      // After handling the authorization code, navigate to the next screen
      navigation.navigate("BottomNav");
    }
  };

  React.useEffect(() => {
    Linking.addEventListener('url', handleDeepLink);
    return () => {
      Linking.removeEventListener('url', handleDeepLink);
    };
  }, []);

  const handleGoogleSignInPopup = async () => {
    try {
      await GoogleSignIn.askForPlayServicesAsync();
      const { type, user } = await GoogleSignIn.signInAsync();

      if (type === 'success') {
        console.log(user);
        setShowModal(false);
        // You might handle the user data here, like sending it to your backend for authentication
      }
    } catch ({ message }) {
      console.error('GoogleSignIn Error:', message);
    }
  };

  return (
    <>
      <SafeAreaView />
      <View style={styles.container}>
        <View style={styles.getStarted}>
          <Text style={styles.getStartedTxt}>Get Started</Text>
        </View>
        <View style={styles.txt1_container}>
          <Text style={styles.txt1}>No More</Text>
          <Text style={styles.txt1}>Seed Phrases</Text>
        </View>
        <View style={styles.txt2_container}>
          <Text style={styles.txt2}>
            Letâ€™s get you started! Sign in with your Google account and get
            access to the wallet immediately
          </Text>
        </View>
        <View style={{ width: 362, height: 362 }}>
          <Image
            source={require("../../assets/images/security_lock_key.png")}
          />
        </View>
        <TouchableOpacity style={styles.googleBtn} onPress={handleGoogleSignIn}>
          <View style={{ display: "flex", flexDirection: "row", gap: 10 }}>
            <Image
              width={24}
              height={24}
              source={require("../../assets/images/google-logo-9808 1.png")}
            />
            <Text
              style={{
                color: "#171717",
                fontWeight: "500",
                fontSize: 18,
                textAlign: "center",
              }}
            >
              Sign in with Google
            </Text>
          </View>
        </TouchableOpacity>
        <Modal
          animationType="slide"
          transparent={true}
          visible={showModal}
          onRequestClose={handleCloseModal}
        >
          <View style={styles.modalContainer}>
            <View style={styles.modalContent}>
              <Text style={styles.modalTitle}>Google Sign In</Text>
              <TouchableOpacity
                style={styles.googlePopupBtn}
                onPress={handleGoogleSignInPopup}
              >
                <Text style={styles.googlePopupText}>Sign in with Google</Text>
              </TouchableOpacity>
              <TouchableOpacity
                style={styles.closeModalBtn}
                onPress={handleCloseModal}
              >
                <Text style={styles.closeModalText}>Close</Text>
              </TouchableOpacity>
            </View>
          </View>
        </Modal>
      </View>
    </>
  );
};

export default OnboardingFive;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
    padding: 20,
  },
  getStarted: {
    backgroundColor: "#EEE0FF",
    borderWidth: 1,
    borderColor: "#000000",
    padding: 8,
    borderRadius: 100,
    marginTop: 50,
  },
  getStartedTxt: {
    fontWeight: "400",
    fontSize: 16,
    textAlign: "center",
    color: "#563380",
  },
  txt1_container: {
    width: "100%",
    alignItems: "center",
    marginBottom: 20,
  },
  txt1: {
    fontWeight: "600",
    fontSize: 36,
    textAlign: "center",
    color: "#000000",
  },
  txt2: {
    fontWeight: "400",
    fontSize: 18,
    textAlign: "center",
    color: "#000000",
  },
  googleBtn: {
    width: "100%",
    height: 60,
    borderRadius: 100,
    borderColor: "#171717",
    backgroundColor: "#fff",
    borderWidth: 1,
    alignItems: "center",
    justifyContent: "center",
    marginTop: 20,
  },
  modalContainer: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "rgba(0, 0, 0, 0.5)",
  },
  modalContent: {
    backgroundColor: "#FFF",
    width: "80%",
    borderRadius: 10,
    padding: 20,
    alignItems: "center",
  },
  modalTitle: {
    fontSize: 20,
    fontWeight: "bold",
    marginBottom: 20,
  },
  googlePopupBtn: {
    backgroundColor: "#DB4437",
    paddingVertical: 10,
    paddingHorizontal: 20,
    borderRadius: 5,
    marginBottom: 10,
  },
  googlePopupText: {
    color: "#FFF",
    fontWeight: "bold",
    fontSize: 16,
  },
  closeModalBtn: {
    marginTop: 10,
  },
  closeModalText: {
    color: "#333",
    fontSize: 16,
  },
});
